response.about:
Во мне гармония ,всё диво,
Всё выше мира и страстей;
И я покоюсь не стыдливо
В красе торжественной своей;
И я кругом себя взираю:
Мне нет соперниц, нет подруг;
Красавиц наших бледный круг
В моём сияньи исчезает

Нет ни чего лучше на свете чем мои дорогие и любимые мальчики зайчики !!!!!Я вас Обожаю Димоня и Андрюша!!!!!
